import { StyleSheet } from "react-native";

export const Styles = StyleSheet.create({
    container:{
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
        backgroundColor: '#000',
    },
    logo:{
        marginTop:'-40%',
        width: 300, 
        height: 300,
        resizeMode: 'contain',
        borderRadius: 10,
    }, 
    title:{
        color: '#fff',
        fontSize: 20,
    },
    bottonForm:{
        backgroundColor: '#'
    }
    
})
